import react from "react";
import { useState } from "react";

const ListStocks = () => {
  const [stockLabel, setStockLabel] = useState("");
  const [stockBuyPrice, setStockBuyPrice] = useState("");
  const [stockQuantity, setStockQuantity] = useState("");
  const [stockBuyDate, setStockBuyDate] = useState("");

  return (
    <>
      <div class="row">
        <div class="col-sm-12">
          <div className="card w-25 mt-5">
            <div className="card-body">
              <h5 className="card-title">Stock Label</h5>
              <p className="card-text">Buy Price: </p>
              <p className="card-text">Quantity: </p>
              <p className="card-text">Date: </p>
              <button className="btn btn-primary">Edit</button>
              <button className="btn btn-danger">Delete</button>
            </div>
          </div>
          <div className="card w-25 mt-5">
            <div className="card-body">
              <h5 className="card-title">Stock Label</h5>
              <p className="card-text">Buy Price: </p>
              <p className="card-text">Quantity: </p>
              <p className="card-text">Date: </p>
              <button className="btn btn-primary">Edit</button>
              <button className="btn btn-danger">Delete</button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default ListStocks;
